import React from 'react';

const NavBar = ({ isAdmin, onLogout, onSwitchToAdmin, onSwitchToUser }) => {
  return (
    <nav className="navbar">
      <ul>
        {!isAdmin && (
          <>
            <li><button onClick={onSwitchToUser}>User Dashboard</button></li>
            <li><button onClick={onSwitchToAdmin}>Admin Login</button></li>
          </>
        )}
        {isAdmin && (
          <>
            <li><button onClick={onSwitchToUser}>User Dashboard</button></li>
            <li><button onClick={onLogout}>Logout</button></li>
          </>
        )}
      </ul>
    </nav>
  );
};

export default NavBar;
